import Link from 'next/link';

const Favorites = () => (
    <div>
        <ul>
           <li><Link href="/"><a>Home</a></Link></li> 
           <li><Link href="/favorites"><a>Favorites</a></Link></li> 
        </ul>
        <h1>Favorites Page</h1>
    </div>
);

export default Favorites;
